import Header from "../Header/Header";
import Menu from "../Menu/Menu";
import Routing from "../Routing/Routing";
import "./Layout.css";
import { LayoutWrapper } from "./Layout.style";

function Layout(): JSX.Element {
  return (
    <LayoutWrapper>
      <StyledMenu />

      <Header />

      <Routing />
    </LayoutWrapper>
  );
}

export default Layout;
